import React from 'react';
import { Container, Typography, Chip, Paper } from '@mui/material';

const Skills = () => {
  const skills = ['Java', 'Spring', 'React', 'JavaScript', 'SQL', 'Agile', 'HTML', 'CSS'];

  return (
    <Paper elevation={3} sx={{ padding: 2, margin: 2 }}>
      <Container>
        <Typography variant="h4" gutterBottom>Skills</Typography>
        <div>
          {skills.map(skill => (
            <Chip key={skill} label={skill} sx={{ margin: 1 }} />
          ))}
        </div>
      </Container>
    </Paper>
  );
};

export default Skills;
